window.bookSummaryJSON = "<p><b>I had the perfect pack until I wasn't enough for them.</b></p> <p>Omegas are supposed to be cherished. Protected. Loved.</p> <p>I thought I was—until my pack found their true scent match and threw me away like I meant nothing.</p> <p>They sent me to the Reassignment Center, where rejected omegas are supposed to find new packs. But omegas like me don't get fairy-tale endings.</p> <p>We get two choices: a low-class pack that no one else wants or the heat dens—where omegas are used until there's nothing left of them.</p> <p>After nine months in hell, I'll take any pack that will have me. Even if they're dangerous. Even if they live outside the law.</p> <p>They claim I'm their scent match. But I'll never make the mistake of giving my heart away again.</p>"; 
